// in:  x=3&y=3&board=CbBbCbAaCbCaCbAbCb
// out: path=0,1_2,1_2,0_0,0_0,2_2,2_1,2_1,0_1,1

#include <cstdio>
#include <cstring>
#include <vector>
#include <algorithm>
#include <ctime>
using namespace std;
#define BIG 5000000

int x, y;
char board[BIG];
char path[BIG];
char tp[100];

vector<int> gra[BIG];
int pos[BIG];

int cnt;
vector<int> ans;
bool vis[BIG];
int line[BIG];
bool visline[BIG];

int drawaline(int u, int dep){
	for(int i=0;i<gra[u].size();i++){
		int v = gra[u][i];
		if(vis[v]) return v;
		if(visline[v]) continue;
		line[dep] = v;
		int res = drawaline(v, dep+1);
		if(res!=-1) return res;
		line[dep] = -1;
	}
	return -1;
}

int dosomething(int v){

	bool circle = false;
	for(int i=0;i<gra[v].size();i++) {
		if(gra[v][i] == ans[0]) {
			circle = true;
			break;
		}
	}

	if(circle){
		printf("****\n");
		int s;
		for(int i=0;i<x*y;i++){
			if(!vis[i]){
				s = i;
				break;
			}
		}

		memset(visline, false, sizeof(visline));
		memset(line, -1, sizeof(line));
		visline[s] = true;
		line[0] = s;

		int tail = drawaline(s, 1);

		vector<int>::iterator it = find(ans.begin(), ans.end(), tail);
		vector<int> tans;

		for(int i=0;line[i]!=-1;i++){
			tans.push_back(line[i]);
		}

		tans.insert(tans.end(), it, ans.end());
		tans.insert(tans.end(), ans.begin(), it);

		ans = tans;

		int thev = *(--ans.end());
		return thev;
	} else return v;
}

bool dfs(int u){
	fprintf(stderr, "~~~ %d %d\n", ans.size(), cnt);
	if(ans.size() == x*y) return true;
	int v;
	while(true) {
		if (pos[u] < gra[u].size()) v = gra[u][pos[u]++];
		else v = gra[u][rand()%gra[u].size()];
		if (!vis[v]) break;

		cnt++;

		// if(cnt>500){
		// 	int ru = dosomething(u);

		// 	if(u!=ru){
		// 		fprintf(stderr, "dosomething %d %d\n", u, ru);
		// 		u=ru;
		// 		continue;
		// 	}
		// }
		vector<int>::iterator it = ++find(ans.begin(), ans.end(), v);
		if(u == *it) reverse(ans.begin(), ans.end());
		else reverse(it, ans.end());
		it = --ans.end();
		u = *it; 
	} 
	vis[v] = true;
	ans.push_back(v);
	return dfs(v);
}

void calc(){

	srand(clock());

	for(int i=0; i<x*y; i++){
		gra[i].clear();
		pos[i] = 0;
	}

	for(int i=0; i<x; i++){
		for(int j=0; j<y ;j++){

			for(int ii=i+1; ii<x ; ii++){
				if((board[(i*y+j)<<2] == board[(ii*y+j)<<2] &&
				board[(i*y+j)<<2|1] == board[(ii*y+j)<<2|1]) ||
				(board[(i*y+j)<<2|2] == board[(ii*y+j)<<2|2] &&
				board[(i*y+j)<<2|3] == board[(ii*y+j)<<2|3])){
					gra[i*y+j].push_back(ii*y+j);
					gra[ii*y+j].push_back(i*y+j);
				}
			}

			for(int jj=j+1; jj<y ; jj++){
				if((board[(i*y+j)<<2] == board[(i*y+jj)<<2] &&
				board[(i*y+j)<<2|1] == board[(i*y+jj)<<2|1]) ||
				(board[(i*y+j)<<2|2] == board[(i*y+jj)<<2|2] &&
				board[(i*y+j)<<2|3] == board[(i*y+jj)<<2|3])){
					gra[i*y+j].push_back(i*y+jj);
					gra[i*y+jj].push_back(i*y+j);
				}
			}

		}
	}

	int s=0;
	while(true){
		memset(vis, false, sizeof(vis));
		vis[s] = true;
		ans.clear();
		ans.push_back(s);
		cnt=0;
		if(dfs(s)) break;
		for(int i=0;i<x*y;i++){
			if(!vis[i]){
				s=i;
				break;
			}
		}
	}
	path[0]=0;
	for(int i=0;i<x*y;i++){
		if(i) strcat(path, "_");
		sprintf(tp, "%X,%X", ans[i]%y, ans[i]/y);
		strcat(path, tp);
	}
}

char msg[BIG];
void recv(){
	scanf("%s", msg);
	sscanf(msg, "x=%d&y=%d&board=%s", &x, &y, &board);
}

void send(){
	memset(msg, 0, sizeof(msg));
	strcpy(msg, "path=");
	strcat(msg, path);
	puts(msg);
	fflush(stdout);
}

int main(){
	while(true){
		recv();
		calc();
		send();
	}
}

